import React, { useEffect, useState } from 'react';
import {
  MDBInput,
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarToggler,
  MDBIcon,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBBtn,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBCollapse,
  MDBTableHead,
  MDBTableBody,
  MDBTable,
  MDBTextArea
} from 'mdb-react-ui-kit';
function App() {
  const [appointments, setAppointments] = useState([]);
  const [empData, setEmpData] = useState();


  const getAllData = async () => {
    try {
      const appointments = await fetch(
        `${process.env.REACT_APP_BASE_URL}/appointments`,
        {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
          },
        }
      );

      const res = await appointments.json();
      console.log(res);
      setEmpData(res);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    getAllData();
  }, []);
  console.log(empData);

  return (
    <div className='w-full max-w-[80%] mx-auto mt-12'>
      <h1 className='text-center mb-6'>Appointment Data</h1>

    <div className='flex flex-col items-start gap-8'>

    <MDBTable align='middle'>
    <MDBTableHead>
      <tr>
        <th scope='col'><p>Lab</p></th>
        <th scope='col'><p>Name</p></th>
        <th scope='col'><p>Email</p></th>
        <th scope='col'><p>Contact</p></th>
        <th scope='col'><p>Service</p></th>
        <th scope='col'><p>Date</p></th>


      </tr>
    </MDBTableHead> Fab Lab Appointment Data
    {empData?.data.map(appointment => {
      if (appointment.lab === "FabLab") {

        return (
          <MDBTableBody key={appointment._id}>
            <tr>
              <td>
                <div className='d-flex align-items-center'>
                  <div className='ms-3'>
                    <p className='fw-bold mb-1'>{appointment.lab}</p>
                  </div>
                </div>
              </td>
              <td>
                <p className='fw-normal mb-1'>{appointment.name}</p>
              </td>
              <td>
                <p>{appointment.email}</p>
              </td>
              <td>
                <div className='details'>
                  <p>{appointment.contact}</p>
                  </div>
              </td> 
              <td>
                <div className='details'>
                  <p>{appointment.service}</p>
                  </div>
              </td>
              <td>
                <div className='details'>
                  <p>{appointment.date}</p>
                  </div>
              </td>
            </tr>
          </MDBTableBody>)
       }
       return null; // Add this line if you want to skip rendering for other cases
     })}
  </MDBTable>
      {/* fablab */}

    </div>

    </div>
  );
}

export default App;
